8\u0439 \u043f\u0440\u043e\u043b\u0438\u0432\">\u0413\u0438\u0431\u0440\u0430\u043b\u0442\u0430\u0440\u0441\u043a\u043e\u043c \u043f\u0440\u043e\u043b\u0438\u0432\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1398_%D0%B3%D0%BE%D0%B4\" title=\"1398 \u0433\u043e\u0434\">1398<\/a>&#160;\u2014 \u043d\u0435\u043c\u0446\u044b \u0432\u044b\u0431\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%80%D0%B0%D1%82%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041f\u0438\u0440\u0430\u0442\u0441\u0442\u0432\u043e\">\u043f\u0438\u0440\u0430\u0442\u043e\u0432<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%82%D0%B0%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B1%D1%80%D0%B0%D1%82%D1%8C%D1%8F\" title=\"\u0412\u0438\u0442\u0430\u043b\u0438\u0439\u0441\u043a\u0438\u0435 \u0431\u0440\u0430\u0442\u044c\u044f\">\u0432\u0438\u0442\u0430\u043b\u0438\u0439\u0441\u043a\u0438\u0445 \u0431\u0440\u0430\u0442\u044c\u0435\u0432<\/a>) \u0441 \u043e\u0441\u0442\u0440\u043e\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4\" title=\"\u0413\u043e\u0442\u043b\u0430\u043d\u0434\">\u0413\u043e\u0442\u043b\u0430\u043d\u0434<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1453_%D0%B3%D0%BE%D0%B4\" title=\"1453 \u0433\u043e\u0434\">1453<\/a>&#160;\u2014 \u0422\u0443\u0440\u0435\u0446\u043a\u0438\u0439 \u0441\u0443\u043b\u0442\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%85%D0%BC%D0%B5%D0%B4_II\" title=\"\u041c\u0435\u0445\u043c\u0435\u0434 II\">\u041c\u0435\u0445\u043c\u0435\u0434 II<\/a> \u043d\u0430\u0447\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%B4%D0%B5%D0%BD%D0%B8%D0%B5_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%BF%D0%BE%D0%BB%D1%8F_(1453)\" title=\"\u041f\u0430\u0434\u0435\u043d\u0438\u0435 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044f (1453)\">\u043e\u0441\u0430\u0434\u0443 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044f<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0437\u0430\u0445\u0432\u0430\u0442\u0438\u043b \u0432 \u043a\u043e\u043d\u0446\u0435 \u043c\u0430\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1652_%D0%B3%D0%BE%D0%B4\" title=\"1652 \u0433\u043e\u0434\">1652<\/a>&#160;\u2014 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8B%D1%81_%D0%94%D0%BE%D0%B1%D1%80%D0%BE%D0%B9_%D0%9D%D0%B0%D0%B4%D0%B5%D0%B6%D0%B4%D1%8B\" title=\"\u041c\u044b\u0441 \u0414\u043e\u0431\u0440\u043e\u0439 \u041d\u0430\u0434\u0435\u0436\u0434\u044b\">\u043c\u044b\u0441 \u0414\u043e\u0431\u0440\u043e\u0439 \u041d\u0430\u0434\u0435\u0436\u0434\u044b<\/a> \u043f\u0440\u0438\u0431\u044b\u043b\u0430 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c \u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%B1%D0%B5%D0%BA,_%D0%AF%D0%BD_%D0%B2%D0%B0%D0%BD\" title=\"\u0420\u0438\u0431\u0435\u043a, \u042f\u043d \u0432\u0430\u043d\">\u042f\u043d\u0430 \u0412\u0430\u043d \u0420\u0438\u0431\u0435\u043a\u0430<\/a>.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1710_%D0%B3%D0%BE%D0%B4\" title=\"1710 \u0433\u043e\u0434\">1710<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%BB%D0%B8%D0%BA,_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041e\u0440\u043b\u0438\u043a, \u0424\u0438\u043b\u0438\u043f\u043f \u0421\u0442\u0435\u043f\u0430\u043d\u043e\u0432\u0438\u0447\">\u0424\u0438\u043b\u0438\u043f\u043f \u041e\u0440\u043b\u0438\u043a<\/a> \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BD%D0%B4%D0%B5%D1%80%D1%8B\" title=\"\u0411\u0435\u043d\u0434\u0435\u0440\u044b\">\u0411\u0435\u043d\u0434\u0435\u0440\u044b<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b \u00ab\u0423\u0441\u0442\u0430\u0432 \u0412\u043e\u0439\u0441\u043a\u0430 \u0417\u0430\u043f\u043e\u0440\u043e\u0436\u0441\u043a\u043e\u0433\u043e\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1716_%D0%B3%D0%BE%D0%B4\" title=\"1716 \u0433\u043e\u0434\">1716<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%BC%D0%BE%D1%82%D1%82,_%D0%90%D0%BD%D1%82%D1%83%D0%B0%D0%BD_%D0%A3%D0%B4%D0%B0%D1%80_%D0%B4%D0%B5\" title=\"\u041b\u0430\u043c\u043e\u0442\u0442, \u0410\u043d\u0442\u0443\u0430\u043d \u0423\u0434\u0430\u0440 \u0434\u0435\">\u0410\u043d\u0442\u0443\u0430\u043d \u0423\u0434\u0430\u0440 \u0434\u0435 \u041b\u0430\u043c\u043e\u0442\u0442<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D1%81%D1%8C%D0%B5,_%D0%90%D0%BD%D0%BD%D0%B0\" title=\"\u0414\u0430\u0441\u044c\u0435, \u0410\u043d\u043d\u0430\">\u0410\u043d\u043d\u0430 \u0414\u0430\u0441\u044c\u0435<\/a> \u0432\u0441\u0442\u0440\u0435\u0442\u0438\u043b\u0438\u0441\u044c \u043d\u0430 \u0437\u0432\u0430\u043d\u043e\u043c \u0443\u0436\u0438\u043d\u0435 \u0438 \u043f\u043e\u0434\u043d\u044f\u043b\u0438 \u0431\u043e\u043a\u0430\u043b\u044b \u0432 \u0447\u0435\u0441\u0442\u044c \u0432\u0435\u043b\u0438\u0447\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BC%D0%B5%D1%80\" title=\"\u0413\u043e\u043c\u0435\u0440\">\u0413\u043e\u043c\u0435\u0440\u0430<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432 \u0442\u0435\u043c \u0441\u0430\u043c\u044b\u043c \u043e\u0434\u043d\u0443 \u0438\u0437 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0445 \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u043d\u044b\u0445 \u043f\u043e\u043b\u0435\u043c\u0438\u043a \u0432\u043e \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0441\u043b\u043e\u0432\u0435\u0441\u043d\u043e\u0441\u0442