tle=\"1795 \u0433\u043e\u0434\">1795<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B7%D0%B5%D0%BB%D1%8C\" title=\"\u0411\u0430\u0437\u0435\u043b\u044c\">\u0411\u0430\u0437\u0435\u043b\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u041f\u0440\u0443\u0441\u0441\u0438\u044f\">\u041f\u0440\u0443\u0441\u0441\u0438\u044f<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1804_%D0%B3%D0%BE%D0%B4\" title=\"1804 \u0433\u043e\u0434\">1804<\/a>&#160;\u2014 \u043f\u0440\u0438 \u043d\u0435\u0432\u044b\u044f\u0441\u043d\u0435\u043d\u043d\u044b\u0445 \u043e\u0431\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430\u0445 \u0432 \u043f\u0430\u0440\u0438\u0436\u0441\u043a\u043e\u0439 \u0442\u044e\u0440\u044c\u043c\u0435 \u0443\u0431\u0438\u0442 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0433\u0435\u043d\u0435\u0440\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%88%D0%B5%D0%B3%D1%80%D1%8E,_%D0%A8%D0%B0%D1%80%D0%BB%D1%8C\" title=\"\u041f\u0438\u0448\u0435\u0433\u0440\u044e, \u0428\u0430\u0440\u043b\u044c\">\u0428\u0430\u0440\u043b\u044c \u041f\u0438\u0448\u0435\u0433\u0440\u044e<\/a>, \u043b\u0438\u0434\u0435\u0440 \u0437\u0430\u0433\u043e\u0432\u043e\u0440\u0430 \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1806_%D0%B3%D0%BE%D0%B4\" title=\"1806 \u0433\u043e\u0434\">1806<\/a>&#160;\u2014 \u0438\u0441\u043f\u0430\u043d\u0446\u044b \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B9%D0%BA%D0%BE%D1%82\" title=\"\u0411\u043e\u0439\u043a\u043e\u0442\">\u0431\u043e\u0439\u043a\u043e\u0442<\/a> \u043f\u043e\u0441\u0442\u0430\u0432\u043e\u043a \u043f\u0440\u043e\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u0438\u044f \u0432 \u0440\u0443\u0441\u0441\u043a\u0438\u0435 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8F%D1%81%D0%BA%D0%B0\" title=\"\u0410\u043b\u044f\u0441\u043a\u0430\">\u0410\u043b\u044f\u0441\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1812_%D0%B3%D0%BE%D0%B4\" title=\"1812 \u0433\u043e\u0434\">1812<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u044f<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0438\u043b\u0438 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f\u0445 \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1814_%D0%B3%D0%BE%D0%B4\" title=\"1814 \u0433\u043e\u0434\">1814<\/a>&#160;\u2014 \u043f\u043e\u0441\u043b\u0435 \u043e\u0442\u043a\u0430\u0437\u0430 \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u043e\u0432 \u0432\u0435\u0441\u0442\u0438 \u0430\u0440\u043c\u0438\u044e \u043d\u0430 \u0437\u0430\u043d\u044f\u0442\u044b\u0439 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u0441\u043e\u044e\u0437\u043d\u0438\u043a\u043e\u0432&#160;\u2014 \u0420\u043e\u0441\u0441\u0438\u0438, \u041f\u0440\u0443\u0441\u0441\u0438\u0438, \u0410\u0432\u0441\u0442\u0440\u0438\u0438 \u0438 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436<\/a> \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I<\/a> \u043e\u0442\u0440\u0451\u043a\u0441\u044f \u043e\u0442 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0430, \u043e\u0434\u043d\u0430\u043a\u043e \u043e\u0442\u0440\u0435\u0447\u0435\u043d\u0438\u0435 \u043d\u0435 \u0431\u044b\u043b\u043e \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u0441\u043e\u044e\u0437\u043d\u044b\u043c \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1815_%D0%B3%D0%BE%D0%B4\" title=\"1815 \u0433\u043e\u0434\">1815<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0438\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%83%D0%BB%D0%BA%D0%B0%D0%BD\" title=\"\u0412\u0443\u043b\u043a\u0430\u043d\">\u0432\u0443\u043b\u043a\u0430\u043d\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%BC%D0%B1%D0%BE%D1%80%D0%B0\" title=\"\u0422\u0430\u043c\u0431\u043e\u0440\u0430\">\u0422\u0430\u043c\u0431\u043e\u0440\u0430<\/a> \u043d\u0430 \u043e\u0441\u0442\u0440\u043e\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%BC%D0%B1%D0%B0%D0%B2%D0%B0\" title=\"\u0421\u0443\u043c\u0431\u0430\u0432\u0430\">\u0421\u0443\u043c\u0431\u0430\u0432\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%BE%D0%BD%D0%B5%D0%B7%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u043e\u043d\u0435\u0437\u0438\u044f\">\u0418\u043d\u0434\u043e\u043d\u0435\u0437\u0438\u0438<\/a>, \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u0432\u0448\u0435\u0435\u0441\u044f \u043d\u0435\u0434\u0435\u043b\u044e. \u041e\u0434\u043d\u043e \u0438\u0437 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0445 \u0438\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0439 \u0432\u0443\u043b\u043a\u0430\u043d\u043e\u0432 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u0430 (\u043e\u0431\u044a\u0451\u043c \u043b\u0430\u0432\u044b \u0438 \u043f\u0435\u043f\u043b\u0430 \u0434\u043e\u0441\u0442\u0438\u0433 180 \u043a\u0443\u0431\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u043a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\u043e\u0432). \u041f\u043e\u0433\u0438\u0431\u043b\u043e 92000 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1818_%D0%B3%D0%BE%D0%B4\" title=\"1818 \u0433\u043e\u0434\">1818<\/a><ul><li>\u0432\u043e\u0437\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D1%82%D1%8C%D1%8F%D0%B3%D0%BE\" title=\"\u0421\u0430\u043d\u0442\u044c\u044f\u0433\u043e\">\u0421\u0430\u043d\u0442\u044c\u044f\u0433\u043e<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B8%D0%BB%D0%B8\" title=\"\u0427\u0438\u043b\u0438\">\u0427\u0438\u043b\u0438<\/a>) \u044e\u0436\u043d\u043e\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0425\u043e\u0441\u0435 \u041c\u0430\u0440\u0442\u0438 \u0440\u0430\u0437\u0431\u0438\u043b\u0438 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0443\u044e \u0430\u0440\u043c\u0438\u044e.<\/li><li>\u0431\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9C%D0%B0%D0%B9%D0%BF%D1%83&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041c\u0430\u0439\u043f\u0443 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041c\u0430\u0439\u043f\u0443<\/a>, \u043f\u043e\u043b\u043e\u0436\u0438\u0432\u0448\u0430\u044f \u043a\u043e\u043d\u0435\u0446 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0438\u0441\u043f\u0430\u043d\u0441\u043a\u043e\u043c\u0443<\/a> \u0433\u043e\u0441\u043f\u043e\u0434\u0441\u0442\u0432\u0443 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B8%D0%BB%D0%B8\" title=\"\u0427\u0438\u043b\u0438\">\u0427\u0438\u043b\u0438<\/a>.<\/li><li>\u0432 \u041f\u0430\u0440\u0438\u0436\u0435 \u0431\u0430\u0440\u043e\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%80%D0%B5%D0%B7,_%D0%9A%D0%B0%D1%80%D0%BB\" title=\"\u0414\u0440\u0435\u0437, \u041a\u0430\u0440\u043b\">\u041a\u0430\u0440\u043b \u0434\u0435 \u0414\u0440\u0435\u0437<\/a> \u043f\u0440\u043e\u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043b \u043f\u0435\u0440\u0432\u043e\u0435 \u0434\u0432\u0443\u0445\u043a\u043e\u043b\u0451\u0441\u043d\u043e\u0435 \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u043e \u043f\u0435\u0440\u0435\u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f (\u043f\u0440\u043e\u043e\u0431\u0440\u0430\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%BE%D1%81%D0%B8%D0%BF%D0%B5%D0%B4\" title=\"\u0412\u0435\u043b\u043e\u0441\u0438\u043f\u0435\u0434\">\u0432\u0435\u043b\u043e\u0441\u0438\u043f\u0435\u0434\u0430<\/a>).<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1843_%D0%B3%D0%BE%D0%B4\" title=\"1843 \u0433\u043e\u0434\">1843<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BD%D0%BA%D0%BE%D0%BD%D0%B3\" title=\"\u0413\u043e\u043d\u043a\u043e\u043d\u0433\">\u0413\u043e\u043d\u043a\u043e\u043d\u0433<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0435\u043c \u0411\u0440\u0438\u0442\u0430\u043d\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1895_%D0%B3%D0%BE%D0%B4\" title=\"1895 \u0433\u043e\u0434\">1895<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B0%D0%B9%D0%BB%D1%8C%D0%B4,_%D0%9E%D1%81%D0%BA%D0%B0%D1%80\" title=\"\u0423\u0430\u0439\u043b\u044c\u0434, \u041e\u0441\u043a\u0430\u0440\">\u041e\u0441\u043a\u0430\u0440 \u0423\u0430\u0439\u043b\u044c\u0434<\/a> \u043f\u0440\u043e\u0438\u0433\u0440\u0430\u043b \u0432 \u0441\u0443\u0434\u0435 \u0434\u0435\u043b\u043e \u043f\u043e \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u044e \u0432 \u043a\u043b\u0435\u0432\u0435\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%83%D0%B3%D0%BB%D0%B0%D1%81,_%D0%94%D0%B6%D0%BE%D0%BD_%D0%A8%D0%BE%D0%BB%D1%82%D0%BE\" class=\"mw-redirect\" title=\"\u0414\u0443\u0433\u043b\u0430\u0441, \u0414\u0436\u043e\u043d \u0428\u043e\u043b\u0442\u043e\">\u043c\u0430\u0440\u043a\u0438\u0437\u0430 \u041a\u0443\u0438\u043d\u0441\u0431\u0435\u0440\u0440\u0438<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043e\u0431\u0432\u0438\u043d\u0438\u043b \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BC%D0%BE%D1%81%D0%B5%D0%BA%D1%81%D1%83%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D1%81%D1%82%D1%8C\" title=\"\u0413\u043e\u043c\u043e\u0441\u0435\u043a\u0441\u0443\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u044c\">\u0433\u043e\u043c\u043e\u0441\u0435\u043a\u0441\u0443\u0430\u043b\u044c\u043d\u043e\u04