u043d\u0430 (\u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0430)\">\u041b\u0443\u043d\u0430-4\u0415<\/a> (\u0437\u0430\u043f\u0443\u0449\u0435\u043d\u043d\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/2_%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8F\" title=\"2 \u0430\u043f\u0440\u0435\u043b\u044f\">2 \u0430\u043f\u0440\u0435\u043b\u044f<\/a> \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%81%D0%BC%D0%BE%D0%B4%D1%80%D0%BE%D0%BC\" title=\"\u041a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c\">\u043a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B9%D0%BA%D0%BE%D0%BD%D1%83%D1%80\" title=\"\u0411\u0430\u0439\u043a\u043e\u043d\u0443\u0440\">\u0411\u0430\u0439\u043a\u043e\u043d\u0443\u0440<\/a>) \u0438\u0437-\u0437\u0430 \u043e\u0442\u043a\u043b\u043e\u043d\u0435\u043d\u0438\u044f \u0442\u0440\u0430\u0435\u043a\u0442\u043e\u0440\u0438\u0438 \u043f\u043e\u043b\u0451\u0442\u0430 \u043e\u0442 \u0440\u0430\u0441\u0447\u0451\u0442\u043d\u043e\u0439 \u043f\u0440\u043e\u0448\u043b\u0430 \u043d\u0430 \u0440\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0438 8500 \u043a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\u043e\u0432 \u043e\u0442 \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%B0\" title=\"\u041b\u0443\u043d\u0430\">\u041b\u0443\u043d\u044b<\/a> \u0438 \u0437\u0430\u0442\u0435\u0440\u044f\u043b\u0430\u0441\u044c \u0432 \u043a\u043e\u0441\u043c\u043e\u0441\u0435. \u041f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u043b\u043e\u0441\u044c, \u0447\u0442\u043e \u0410\u041c\u0421 \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442 \u043c\u044f\u0433\u043a\u0443\u044e \u043f\u043e\u0441\u0430\u0434\u043a\u0443 \u043d\u0430 \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u044c \u041b\u0443\u043d\u044b.<