=\"https:\/\/ru.wikipedia.org\/wiki\/1986_%D0%B3%D0%BE%D0%B4\" title=\"1986 \u0433\u043e\u0434\">1986<\/a>&#160;\u2014 \u0432\u0437\u0440\u044b\u0432 \u043d\u0430 \u0434\u0438\u0441\u043a\u043e\u0442\u0435\u043a\u0435 La Belle (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D1%8B%D0%B9_%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0417\u0430\u043f\u0430\u0434\u043d\u044b\u0439 \u0411\u0435\u0440\u043b\u0438\u043d\">\u0417\u0430\u043f\u0430\u0434\u043d\u044b\u0439 \u0411\u0435\u0440\u043b\u0438\u043d<\/a>), \u0438\u043d\u0438\u0446\u0438\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0438\u0432\u0438\u044f\">\u041b\u0438\u0432\u0438\u0438<\/a>. \u041e\u0442 \u043c\u043e\u0449\u043d\u043e\u0439 \u0431\u043e\u043c\u0431\u044b \u0442\u0440\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430&#160;\u2014 \u0434\u0432\u0430 \u0441\u043e\u043b\u0434\u0430\u0442\u0430 \u0430\u0440\u043c\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u0438 \u0434\u0435\u0432\u0443\u0448\u043a\u0430 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0438<\/a>&#160;\u2014 \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u043d\u0430 \u043c\u0435\u0441\u0442\u0435, \u0431\u043e\u043b\u0435\u0435 250 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u0440\u0430\u043d\u0435\u043d\u0438\u044f.<\/li><li><a href